import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { motion } from "framer-motion";
import "./SendEmail.css"; // Import file CSS

function SendEmail() {
  const [subject, setSubject] = useState("");
  const [message, setMessage] = useState("");
  const [status, setStatus] = useState({ type: "", text: "" });
  const navigate = useNavigate();
  const recipientEmail = "group.nmc@psn.co.id";

  useEffect(() => {
    if (!localStorage.getItem("email") || !localStorage.getItem("password")) {
      navigate("/");
    }
  }, [navigate]);

  const handleSendEmail = async (e) => {
    e.preventDefault();
    try {
      const email = localStorage.getItem("email");
      const password = localStorage.getItem("password");

      await axios.post("http://192.168.1.13:4000/send-email", {
        email,
        password,
        to: recipientEmail,
        subject,
        message,
      });

      setSubject("");
      setMessage("");
      setStatus({ type: "success", text: "✅ Email sent successfully!" });
      setTimeout(() => setStatus({ type: "", text: "" }), 3000);
    } catch (err) {
      setStatus({ type: "error", text: "❌ Failed to send email. Please try again." });
      console.error("Email sending error:", err);
    }
  };

  return (
    <motion.div 
      className="send-email-container"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.8, ease: "easeOut" }}
    >
      <motion.div 
        className="send-email-card"
        initial={{ opacity: 0, y: 50 }} 
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 1, ease: "easeOut" }}
      >
        <motion.img 
          src="/logonmc1.png" 
          alt="Logo" 
          className="logo"
          initial={{ opacity: 0, scale: 0.8 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 1, ease: "easeOut" }}
        />
        <h2 className="title">Halo NMC Team!</h2>
        <p className="subtitle">Silakan submit daily activity kamu sebelum pulang</p>

        {status.text && (
          <motion.div 
            className={`alert ${status.type === "success" ? "alert-success" : "alert-danger"}`}
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.5, ease: "easeOut" }}
          >
            {status.text}
          </motion.div>
        )}

        <form onSubmit={handleSendEmail} className="form-container">
          <div className="form-group">
            <label className="form-label">Recipient Email</label>
            <input type="email" className="form-control" value={recipientEmail} readOnly />
          </div>
          <div className="form-group">
            <label className="form-label">Subject</label>
            <motion.input
              type="text"
              className="form-control"
              placeholder="Enter email subject"
              value={subject}
              onChange={(e) => setSubject(e.target.value)}
              required
              whileFocus={{ scale: 1.02 }}
            />
          </div>
          <div className="form-group">
            <label className="form-label">Detail</label>
            <motion.textarea
              className="form-control"
              placeholder="Input your daily activity"
              value={message}
              onChange={(e) => setMessage(e.target.value)}
              required
              rows="5"
              whileFocus={{ scale: 1.02 }}
            ></motion.textarea>
          </div>
          <motion.button 
            type="submit" 
            className="btn-submit" 
            disabled={!subject || !message}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Submit
          </motion.button>
        </form>

        <motion.button 
          className="btn-logout" 
          onClick={() => navigate("/logout")}
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
        >
          Logout
        </motion.button>
      </motion.div>
    </motion.div>
  );
}

export default SendEmail;
